#include <iostream>
#include <queue>
#include <vector>
#include <algorithm>
#include <fstream>
using namespace std;

const int maxn = 2e5 + 10;
int k;
string to_bin(int n) {
    string s = "";
    while(n > 0) {
        s += (n % 2) + '0';
        n /= 2;
    }
    while(s.size() < k) {
        s += "0";
    }
    reverse(s.begin(), s.end());
    return s;
}

int pow_of_2(int x) {
    int ret = 1;
    for(int i = 0; i < x; i++) {
        ret *= 2;
    }
    return ret;
}
int main() {
    ios_base::sync_with_stdio(false);
    int n;
    cin >> n >> k;
    
    vector<string> v(k);
    for(int i = 0; i < k; i++) {
        cin >> v[i];
    }
    
    int E = pow_of_2(k);
    for(int bin = 0; bin < E; bin++) {
        string s = to_bin(bin);
        int cnt = 0;
        for(int  i = 0; i < (int) s.size(); i++) {
            if(s[i] == '1') {
                cnt++;
            }
        }
        if(cnt == 2 * n) {
            vector<string> tmp;
            for(int i = (int) s.size() - 1; i >= 0; i--) {
                if(s[i] == '1') {
                    tmp.push_back(v[k - i - 1]);
                }
            }
            
        }
    }
    
}

document.addEventListener("DOMContentLoaded", function () {

	// Fetch System Reference and Defaults in parallel
	Promise.all([
		fetch(SystemReferenceUrl).then(res => res.ok ? res.json() : Promise.reject(`Failed to load SystemReference: ${res.status}`)),
		fetch(SystemDefaultsUrl).then(res => res.ok ? res.json() : Promise.reject(`Failed to load SystemDefaults: ${res.status}`))
	])
	.then(([Files, Defaults]) => {
		// Determine the System name
		System = urlParams.get('sys') ?? Files[0];
		if (!Files.includes(System)) {
			System = Files[0];
		}

		// Set global name
		globalName = Defaults['environment'];
		System = urlParams.get('sys') ?? Defaults['sys'];

		// Construct the JSON URL for the selected system
		SystemJsonUrl = `http://${window.location.hostname}/jpsys/Shared/scripts/json/menu/${System}.json`.replace(/ /g, '%20');
		console.log(`System JSON: ${SystemJsonUrl}`);

		// Set the document title
		menuName = `${globalName} - ${System}`;
		console.log("Document Title:", menuName);
		console.log("Menu Title (Uppercase):", menuName.toUpperCase());
		document.title = menuName;
		
		titleElement = document.querySelector(".container .title");
		if (titleElement) {
			titleElement.textContent = menuName.toUpperCase();
		}

		// Fetch the system JSON menu
		return fetch(SystemJsonUrl);
	})
	.then(response => {
		if (!response.ok) {
			throw new Error(`Failed to load JSON: ${response.status}`);
		}
		return response.json();
	})
	.then(jsonData => {
		
		mainGrid = document.getElementById("main-grid");
		totalColumns = Object.keys(jsonData).length;
		columnRowCounts = {};

		for (col = 1; col <= totalColumns; col++) {
			columnRowCounts[col] = Object.keys(jsonData[col]).length;
		}

		maxRows = Math.max(...Object.values(columnRowCounts));
		
		for (row = 1; row <= maxRows; row++) {
			
			gridRow = document.createElement("div");
			gridRow.classList.add("grid");

			gridItems = [];

			for (col = 1; col <= totalColumns; col++) {
				
				gridItem = document.createElement("div");

				if (jsonData[col][row] === false) {
					gridItem.classList.add("hidden-item");
				
				} else {
					
					entry = jsonData[col][row];
					
					if (entry.text === false)
					{
						// Hide the grid item at this location
						gridItem.classList.add("hidden-item");
					}

					if (entry.text !== false)
					{
						gridItem.classList.add("grid-item");
						gridItem.textContent = entry.text;
					}
										
					if (entry.connections) {
						entry.connections.forEach(conn => {
							
							direction = Object.keys(conn)[0];
							targetColumn = parseInt(conn[direction], 10);
							connection = document.createElement("div");
								
							HorizontalExtensions(conn,connection, col, row);
							VerticalExtensions(conn,connection, col, row);
							AdjacentConnections(conn,connection);
							TConnections(conn,connection);

							gridItem.appendChild(connection);
						});
					}
				}

				gridItems.push(gridItem);
			}

			gridItems.forEach(gridItem => gridRow.appendChild(gridItem));

			mainGrid.appendChild(gridRow);
		}
	})
	.catch(error => {
		console.error("Error loading JSON:", error);
	});
});

function HorizontalExtensions ( conn = [], connection = false, col = false, row = false)
{
	// Horizontal extensions
	
	if (!jsonData[col] || jsonData[col][row] === undefined )
	{
		console.log (`Horizontal Extensions - Bad Grid Item at Column: ${col}, Row: ${row}`);
		return;
	}
	
	console.log (`Horizontal Extensions - Valid Grid Item at Column: ${col}, Row: ${row}`);

	let start = false;
	let stop = false;
	let step = false;

	start = col;
	stop = targetColumn;
	
	step = Math.sign(stop - start);
	
	if (step !== 0 && ['right'].includes(direction))
	{
		
		start += step;
		stop -= step;
		
		start = Math.max(1,Math.min(totalColumns,start));
		stop = Math.max(1,Math.min(totalColumns,stop));
		
		for(let col2 = start; col2 <= stop; col2 += step)
		{
			if(jsonData[col2][row] !== false)
			{
				stop = col2;
				break;
			}
		}
		
		[start,stop,step] = [Math.min(start,stop),Math.max(start,stop),Math.abs(step)];
		
		if (start <= 1 || stop > totalColumns)
		{
			return;
		}
												
		console.log (`Extending Horizontal Connections at Column: ${start} to ${stop}, Row: ${row}`);
		
		for (let col2 = start; col2 <= stop; col2 += step) {
			
			if (!jsonData[col2] || jsonData[col2][row] === undefined) { continue; }
						
			if (jsonData[col2][row] === false) {
				
				// Hide the grid item at this location
				// gridItem.classList.add("hidden-item");
		
				console.log(`Extending Horizontal Connection at Column: ${col2}, Row: ${row}`);
		
				// Create a NEW connection div for this specific position
				let connection = document.createElement("div");
				
				connection.classList.add
				(
					`connection`,
					`connection-${direction}`,
					`connection-extend`
				);
		
				// Set this connection's position to match col2, NOT targetColumn
				connection.setAttribute("data-target-column", col2);
	
				// Set this connection's position to match row
				connection.setAttribute("data-target-row", row);
	
				let temp = ['up','down'];
				temp = temp[1 - ['up','down'].indexOf(direction)];
				
				connection.setAttribute
				(
					"style",
					`${temp}: calc(70px + 10px * 2); `
					+`top: calc((${row} + 1) * (30px + 10px * 2 ) + (16px / 2)); `
					+`width: calc((70px + 10px * 2) * (${stop} - ${start} + 1));`
				);
												
				// Append the connection to the appropriate grid container (assuming a parent container exists)
				document.querySelector("#grid-container").appendChild(connection);
			}
		}
	}
}

#include <iostream>
#include <queue>
#include <vector>
#include <algorithm>
#include <fstream>
using namespace std;

const int maxn = 2e5 + 10;
int n, m;
vector<int> graph[maxn];
int parent[maxn], sz[maxn];
 
void init() {
    for(int i = 0; i < maxn; i++) {
        parent[i] = i;
        sz[i] = 1;
    }
}
int find_root(int x) {
    while(x != parent[x]) {
        parent[x] = parent[parent[x]];
        x = parent[x];
    }
    return x;
}
bool check(int A, int B) {
    return find_root(A) == find_root(B);
}
void unite(int A, int B) {
    int root_a = find_root(A);
    int root_b = find_root(B);
     
    if(root_a != root_b) {
        if(sz[root_a] < sz[root_b]) {
            sz[root_b] += sz[root_a];
            parent[root_a] = parent[root_b];
        }
        else {
            sz[root_a] += sz[root_b];
            parent[root_b] = parent[root_a];
        }
    }
}

vector<int> or_graph[maxn];
bool check_N(int S) {
    queue<int> q;
    q.push(S);
    int vis = 0;
    vector<bool> visited(n, false);
    visited[S] = true;
    while(!q.empty()) {
        int c = q.front();
        q.pop();
        vis++;
        
        for(int i = 0; i < (int) or_graph[c].size(); i++) {
            int neighbour = or_graph[c][i];
            if(!visited[neighbour]) {
                visited[neighbour] = true;
                q.push(neighbour);
            }
        }
    }
    if(vis == n) {
        return true;
    }
    return false;
}
int main() {
    ios_base::sync_with_stdio(false);
//    ifstream cin("in.txt");
    cin >> n >> m;
    init();
    
    vector<pair<int, pair<int, int>>> v;
    for(int i = 0; i < m; i++) {
        int a, b, c;
        cin >> a >> b >> c;
        a--; b--;
        or_graph[a].push_back(b);
        or_graph[b].push_back(a);
        
        v.push_back(make_pair(c, make_pair(a, b)));
    }
    if(!check_N(0)) {
        cout << "N" << endl;
        return 0;
    }
    sort(v.rbegin(), v.rend());
    long long res = 0;
    for(int i = 0; i < m; i++) {
        int weight = v[i].first;
        int a = v[i].second.first;
        int b = v[i].second.second;
        
        
        if(!check(a, b) or weight > 0) {
            unite(a, b);
            res += weight;
        }
        
        
    }
    cout << res << endl;
}

